import styled from 'styled-components'
import React from 'react'
import {Product} from '../../graphqlTypes/types'

const Box = styled.div`
  
`

export const ProductItem = ({product}: {product: Product}) => {
  return <Box
      key={`ProductItem_${product.id}`}
  >
    {product.name}
  </Box>
}
